def calculate_total_brightness(n, q, c, stars, views):
    g = [[[0] * (c + 1) for _ in range(101)] for _ in range(101)]
    for (x, y, s) in stars:
        g[x][y][s] -= 1
    for b in range(c + 1):
        for i in range(1, 101):
            for j in range(1, 101):
                g[i][j][b] += g[i - 1][j][b] + g[i][j - 1][b] - g[i - 1][j - 1][b]
    results = []
    for (t, x1, y1, x2, y2) in views:
        res = 0
        for b in range(c + 1):
            brightness = (t + b) % (c + 1)
            count = g[x2][y2][b] - g[x2][y1 - 1][b] - g[x1 - 1][y2][b] + g[x1 - 1][y1 - 1][b]
            res += brightness * count
        results.append(res)
    return results

